import React from "react";
import "./Popular.css";
import data from '/'

const Popular: React.FC = () => {

      return (<>
      <div id="popular">
        <h1>popular restaurant in epicure:</h1>
        <div>
            <div>{data.chef.id}</div>
            <div></div>
            <div></div>
        </div>
      </div>
        </>
      )
    }

export default Popular;
